import ReturnTitle from './Title';
import CalenderActif from './Calender/Main';
import { ReactToprint } from 'react-to-print';

// Actif Return Component
export default function ReturnActif() {
 return (
  <div>

   <ReactToprint

    trigger={() => {
     return <button>Print to the table</button>
    }}
    pageStyle='print'
    content={() => this.componentRef}

   // documentTitle='new document'
   // onAfterPrint={() => { console.log(`document print`) }}

   />

   <div className='wrp-actif'>
    <ReturnTitle />
    <CalenderActif />
   </div>
  </div>
 );
};
